ach trapezoid\n        Ai = dx * (f(x0,td) + f(x1,td))/ 2.;\n        \n        // cumulatively sum the areas\n        Area = Area + Ai    \n        \n    } \n    return Area;\n}\n\n\n//define function to be integrated\nfunction f1(x,td){\n    return x / td * Math.exp(Math.pow(x/td,2)) * Math.exp(-x/8.77);\n}\n\nfunction f2(x,td){\n    return x / td * Math.exp(Math.pow(x/td,2)) * Math.exp(-x/111);\n}\n\ndx = 0.1;       // width of the trapezoids\n\nvar tni = 8.8;\nvar tco = 111.3;\nvar epni = 3.9e10;\nvar epco = 6.8e9;\nvar beta = 13.8;\nvar c = 1.0e10;\nvar msol = 2e33;\nvar m = mej.value;\nm = m * msol;\nvar mni = fni.value;\nmni = mni * m;\nvar v = vej.value;\nv = v * Math.pow (10,5);\nvar k = k.value;\nvar td = Math.sqrt(2. * k * m / (beta * c * v)) / 86400;\nvar data = source.data;\nx = data['x']\ny = data['y']\nfor (j = 0; j &lt; x.length; j++) {\n    int1 = numerically_integrate(0,x[j],dx,f1,td);\n    int2 = numerically_integrate(0,x[j],dx,f2,td);\n    factor = 2 * mni / td * Math.exp(-Math.pow(x[j]/td,2));\n    y[j] = factor * ((epni-epco) * int1 + epco * int2);\n}\nsource.change.emit();\n"},"id":"4b0992a6-4bb8-4716-a7ac-6338097dd216","type":"CustomJS"},{"attributes":{"source":{"id":"982c4566-06dd-457c-b77a-1a756205c73a","type":"ColumnDataSource"}},"id":"bee9af77-39d1-482e-b885-6074404d55c9","type":"CDSView"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"#1f77b4"},"line_alpha":{"value":0.1},"line_color":{"value":"#1f77b4"},"size":{"units":"screen","value":5},"x":{"value":58099.09},"y":{"value":20.33258420894275}},"id":"b39725de-2c55-40de-8e9c-c6ee66b26570","type":"Circle"},{"attributes":{"data_source":{"id":"a5337311-6f75-45ae-a5df-052d60cc842d","type":"ColumnDataSource"},"glyph":{"id":"0427a1a4-ecc9-4501-a689-64b90ba2b73f","type":"Circle"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"b39725de-2c55-40de-8e9c-c6ee66b26570","type":"Circle"},"selection_glyph":null,"view":{"id":"d826e099-786e-4ea4-acad-025cf4d10326","type":
